<ol>
<li>Configuring runners like jest is a pain, so many options, so many things, it does it all, transform, parse, move, assert, coverage, it's just too many things</li>
<li>This makes them slow</li>
<li>Runners should be a thing from your runtime, they shouldn't be an extra library that you have to take care of. Remember, each library you have is external code you don't maintain, and yet, you rely on</li>
<li>Each test runner is completely different from each other in configuration, they make sure you will only be able to use them and nothing else</li>
<li>They're either not extensible enough, or they are extremely extensible, there's no middle ground</li>
<li>TypeScript is the nemesis of test runners. They're particularly hard to configure when you want to transpile ts on the fly
6.1. Mostly because you have to download other libraries to that for you, which, is yet another lib</li>
<li>Test runners spawn like rats, there's one new everyday, most of them are just more of the same, but this creates a huge bloat in the ecosystem (and they don't interop)</li>
</ol>
